import { Layout, Menu, Breadcrumb, Row, Col } from "antd";
import "./Profile.css";
import Icon, { MenuOutlined, CaretDownOutlined } from "@ant-design/icons";
const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

const Profile = () => {
  return (
    <div className="profile">
      <Layout>
        <Sider width={200} className="site-layout-background">
          <div>
            <Row>
              <Col flex="45px">
                <img
                  src="https://salt.tikicdn.com/desktop/img/avatar.png"
                  alt=""
                  style={{ width: 45, borderRadius: 50 }}
                />
              </Col>
              <Col flex="150px">
                <div>Tài khoản của Trần Khánh Gia Uy</div>
              </Col>
            </Row>
          </div>
          <Menu
            mode="inline"
            defaultSelectedKeys={["1"]}
            style={{ height: "100%", borderRight: 0 }}
          >
            <Menu.Item key="1">Thông tin tài khoản</Menu.Item>
            <Menu.Item key="2">Quản lý đơn hàng</Menu.Item>
            <Menu.Item key="3">option3</Menu.Item>
            <Menu.Item key="4">option4</Menu.Item>
          </Menu>
        </Sider>
        <Content className="site-layout-background">Content</Content>
      </Layout>
    </div>
  );
};

export default Profile;
